import React from 'react';
import ReactDOM from 'react-dom/client';


const myElement = (<div>
  <>
    <p>I am a paragraph.</p>
    <p>I am a paragraph too.</p>
  </>
</div>)

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(myElement);
